       "  'job_description': 'DescriptionOxa is enabling the transition to self-driving vehicles through an initial focus on the most commercially advanced sector; the autonomous shuttling of goods and people.We are home to some of the world’s leading experts on autonomous vehicles, creating solutions such as Oxa Driver, equipping vehicles with full self-driving functionality; Oxa MetaDriver, using Generative AI to accelerate and assure the safety of deployments; and Oxa Hub, a set of cloud-based offerings for autonomous fleet management. Our technology is being deployed across the UK and the U.S, and we’re partnering with a fast-growing ecosystem of operators, vehicle OEMs and equipment makers serving autonomous transportation globally as it advances.Based in Oxford, and with offices in Canada and the U.S, Oxa was founded in 2014 and is growing rapidly (350+ ‘Oxbots’ to date). Our purpose is to change the way the Earth moves, through an uncompromising focus on safety, efficiency and explainability of our AI approaches. The company has attracted $225 million from leading investors so far, with $140 million raised in the last Series C funding round in January 2023.Your TeamYou will join and support our Assurance team, where we set the North Star for assurance and prepare for the safe commercial deployment of all of our products. You will also work closely with peers within the Metrics team with regular interactions with safety engineering, solutions, validation and MetaDriver.Your RoleAs our Assurance Software Engineer you will work within the Assurance function of Oxa to demonstrate assurance of the safety, regulatory, and performance compliance of Oxa’s software.Alongside This You Will AlsoAnswer challenging questions on assuring self-driving that have been extensively researched without consensus in the industry.Define and generate assurance metrics from telemetry and simulated data necessary to ascertain Oxa’s assurance for internal and external use.Define acceptance criteria for assurance metrics that prove Oxa’s software is safe, lawful, and performing.Use various data science techniques to validate Oxa’s software.Utilise Oxa’s MetaDriver simulator for assurance purposes.Own the development of Oxa’s assurance reporting features.Serve as a key liaison between product engineering teams and assurance functions, translating complex software requirements into comprehensible assurance arguments.RequirementsWhat you need to succeed:Proficiency in Python software development skills (tools such as debugger, IDE and profilers).Solid software engineering design principles and up-to-date knowledge of Python best practices.Knowledge of Python build systems (e.g. Bazel, Pants, Poetry, Conda build)Proficient with Git.Proficient with data science libraries such as pandas, numpy, scipy, etc.An understanding of machine learning.UI skills for interacting with dashboards constructed using Grafana, Apache Superset, etc.Experience with databases (e.g., SQL).Deep data and statistical analysis knowledge.Maintaining high-quality code documentation.Insight into what assurance metrics are needed for moving Oxa forward.Ability to translate numbers into meaningful and informative diagrams.Strong communication skills on technical subjects.Extra KudosExperience using cloud technologies such as GCP and using infrastructure as code (deploying cloud services).An understanding of AI safety.Familiarity with Robotics.An understanding of data streaming processes.The Candidate Journey: Multi-Step and Two-WayNo-one wants to feel like a square peg in a round hole, so this process is designed to give you every chance to get the measure of us, and us of you. The various stages give you every opportunity to show your unique strengths and qualities, and enables each of us to establish if we’re a good fit for the other. If the fit is good and you’re selected, you’re then in a position to do great work and thrive, which is what everyone wants.BenefitsWe provide:Competitive salary, benchmarked against the market and reviewed annuallyCompany share programmeHybrid and/or flexible work arrangementsAn outstanding £3,000 flexible benefits including private medical insurance, critical illness coverage, life assurance, EAP, group income protectionFunded relocation support Fully funded Visa sponsorship if requiredA salary exchange pension plan25 days’ annual leave plus bank holidaysA pet-friendly office environmentSafe assigned spaces for team members with individual and diverse needsOur CultureWe believe that diversity of thought and experience is a key driver of innovation. It also makes life, and work, more interesting. So ours is a culture that celebrates humanity in all its diversity and richness, and uses difference as fuel to grow and succeed together. Everyone is welcome, everyone has a voice, everyone is valued. And our work and people are all the better for it.Learn more about our culture here.[Link to careers page.]Why become an Oxbot? Our team of experts in computer science, AI, robotics and machine learning is world-class, and together they’re solving the most exciting and important technological challenges of our times.But as well as smarts, Oxbots have heart. Our diverse, multi-cultural crew is guided by a shared vision to bring the myriad benefits of autonomy to our customers and partners. And in a company that celebrates uniqueness as much as skill and experience, they do it with energy, conviction and a healthy dose of excitement, too.If you are bold, creative and hyper skilled, come and create the future of autonomy with us at Oxa.',\n",
