       "  'job_description': 'Who We Are And What We DoDeel is a global team that helps businesses hire anyone, anywhere, easily. Deel consists of more than three thousand self-driven individuals spanning over 100 countries. Our unified yet diverse culture keeps us continually learning and innovating the Deel platform and our products for customers.Companies should be able to hire the best talent anywhere in the world, so we are building the best platform to make that a reality. Our market-leading technology, expertise, and global team are crucial to the success of Deel’s platform. We deliver the best products and platform features in our space, enabling millions of jobs worldwide and connecting the global workforce with the best companies and opportunities.Why should you be part of Deel\\'s success story?A 30-mile hiring radius should no longer dictate how companies hire because great talent lives everywhere. Deel sees a world without hiring borders and endless talent that pairs perfect candidates with great companies.We offer global teams all the tools they need to hire, onboard, manage, pay, and scale at full speed. We aim to foster a diverse global economy by building a generational platform that seamlessly connects companies with talent worldwide.After our successful Series D in 2021, we raised another $50M last year, doubling our valuation to $12B.There’s never been a more exciting time to join Deel — the market leader in international payroll and compliance.Get ready to:Be a part of a truly cross-functional team; Engineer, Product, Data Science and Business Stakeholders.Participate in product planning (From discovery all the way to deployment); We want your input at all stages of the Software Development Lifecycle!Collaborate! Our teams work together to develop robust new features, Machine Learning, continuously improve our industry-leading products and find and fix any bugs at Deel Speed.Ensure our customers receive a white-glove experience with our products!The bits and bytes you’ll bring to the team:Developing and maintaining AI and machine learning algorithms using Python.Creating and maintaining data pipelines and ETL processes to extract, transform, and load data from various sources.Building and deploying scalable, reliable, and efficient AI models using cloud computing platforms.Collaborating with cross-functional teams including data scientists, data engineers, Product and business stakeholders to understand business requirements and develop solutions that meet those requirements.Writing clean and efficient code, and implementing best practices for code optimization, testing, and deployment through Jupyter Notebooks and/or Google Colab.Conducting research and staying up-to-date with the latest AI and Machine Learning techniques, and incorporating new ideas and methods into existing systems.Troubleshooting and debugging code, and resolving technical issues that arise during the development, testing, and deployment process.Creating documentation for code, data pipelines, and models to ensure that all stakeholders have access to clear and accurate information.Participating in code reviews and contributing to the development of a strong engineering culture within the organization.You’re the Engineer we’re looking for if you have:High proficiency in Python, PostgreSQL, and the data science stack.Background and experience in Back-End engineering in production environments (5+ years) (Mid/Senior Level role)Background and hands-on experience (2+ years) in implementing research and algorithms in Python, specifically in information retrieval, text processing, NLP, and machine learningProven experience delivering AI/Machine Learning solutions inside a product.Track record of good written and verbal communication of complex things in a simple way as well as the ability to collaborate well with people from different backgrounds and professionsA Bachelor’s degree or higher in a STEM/Computer science related fieldTotal RewardsOur workforce deserves fair and competitive pay that meets them where they are. With scalable benefits, rewards, and perks, our total rewards programs reflect our commitment to inclusivity and access for all.At Deel, you’ll enjoy:Computer equipment applicable to your roleStock grant opportunitiesAdditional perks and benefits based upon your employment status and countryThe ability to choose where you work whether it be your home, the beach, or a WeWorkAt Deel, we\\'re an equal opportunity employer and value diversity at our company. We do not discriminate based on race, religion, color, national origin, gender, sexual orientation, age, marital status, veteran status, disability status, or other applicable legally protected characteristics.\"Please note that we will only communicate with our job applicants by using @deel.com domains. We will never contact applicants from any other email address. We will never ask for money from potential employees. Be cautious of any unauthorized solicitations. You may view the most current and accurate job postings at Deel by visiting https://www.deel.com/careers.',\n",
