       "  'job_description': \"About Allego:Allego is on a mission to reshape modern revenue enablement, with our roots in Boston, Massachusetts, and a key focus on expanding our UK team in the vibrant city of Newcastle-upon-Tyne. As a rapidly growing SaaS firm, we've achieved consistent double-digit growth over a decade, thanks to our AI-driven, seller-centric Allego Sales Enablement Platform. This platform delivers unmatched efficiency, designed to ease organisations’ need to drive better sales results in today’s hybrid world. Serving nearly 1 million users across 65 countries, we’re recognised by Gartner and Forrester as market leaders, supporting a wide array of sectors, including banking, insurance, medical device, pharmaceutical, wealth management, and asset management sectors, across one-quarter of Dow Jones Industrial Average companies. This includes 5 of the 15 largest U.S. banks, 4 of the 8 largest insurance providers, 4 of the 5 largest global medical device companies, 6 of the 10 largest wealth management firms, 5 of the 5 largest asset management companies, and many other global enterprises.Our ambition extends to mirroring this success within the UK and EMEA markets, fostering growth that's rooted in our people as much as our numbers. Allego's culture and work environment have garnered accolades from The Boston Business Journal, The Boston Globe, Inc. Magazine, and Selling Power as one of the 50 Best Companies to Sell For, three years in a row (2020-2022). As we bolster our UK presence, we're looking for talented individuals to join our Newcastle team, contributing to our global narrative of innovation and excellence in revenue enablement.How you’ll make a difference:Allego is looking for a talented and motivated individual to join our Web Development team. In our collaborative and flexible work environment, you’ll have the opportunity to rapidly build your technical skills in a new, exciting, and expanding product space. You’ll work closely with a multi-disciplined team to build a product that transforms the way ideas are shared and learning happens. You will be integral to Allego’s success through:Collaborating with the product management team to weigh options to satisfy requirements, providing feedback on requirement feasibility, architecture and UI/UX designsDesigning, building, and delivering features in multiple areas of the productReviewing code and mentoring other engineersContinually improving our technical stack and processesMaintaining existing tools and infrastructure as necessaryThe ideal candidate will have:Minimum 3 years of experiencePassion for web development and cross-browser compatibilityStrong working knowledge of JavaScript, HTML, CSS and JSONStrong working experience with Java & J2EE stackAbility to independently diagnose and solve code problems using appropriate tools and resourcesExperience using browser dev-tools for debugging problemsAbility to effectively collaborate with team members in a fast-paced, Agile development environmentBachelor’s Degree in Computer Science, Engineering, Software Development, or a combination of education and equivalent experience in a related field Preferred (but Not Essential)Experience building UI in ReactExperience with jQuery (or a similar framework)Experience with a modern front-end build pipeline (gulp / webpack / npm / babel etc.)Experience with Git (or a similar version control system)Experience with the Java Spring framework and struts would also be advantageousAbout YouWe promote an open and vibrant culture, filled with personality. Everyone is essential to achieve our business goals, and that includes you!You should be highly motivated, able to work cohesively within a team and able to manage your own workload and priorities too. At Refract, an Allego Company, we leave the ego at the door. You should be ready to put your best foot forward, and join in the learning and development culture where we work together to better ourselves and the success of the business.PackageThis is a full time role with:Up to £52.5k depending on experience5% matched pension contributions Fully flexible working hours25 days annual leave plus 8 bank holidaysPrivate medical insurance availableThis position is hybrid, combining both remote and in-office responsibilities. While most of your work can be done remotely, there may be times when your presence in the office is necessary, such as for company-wide meetings, social gatherings, or collaborative sessions. Additionally, you're encouraged to utilise the office space as frequently as you prefer.Other BenefitsLots of career progression opportunity, plus personal and professional developmentRelaxed and social working environmentRegular team social events\",\n",
