       " {'job_position': 'AI/ML Engineer',\n",
       "  'job_link': 'https://uk.linkedin.com/jobs/view/ai-ml-engineer-at-gravity9-3834196286?position=9&pageNum=7&refId=dB5talFTm4NhMKQ6X%2FKDHw%3D%3D&trackingId=gjTlF5SwWMfj%2BGSgfiGYng%3D%3D&trk=public_jobs_jserp-result_search-card',\n",
