       "  'company_name': 'gravity9',\n",
       "  'company_profile': 'https://uk.linkedin.com/company/gravity-9?trk=public_jobs_jserp-result_job-search-card-subtitle',\n",
       "  'job_location': 'United Kingdom',\n",
