       "  'job_posting_time': '2 weeks ago',\n",
       "  'base_pay': '',\n",
       "  'job_description': \"Join Our Growing Team - Future Opportunities Await!We are excited to share that our company is experiencing significant growth and expansion, and as a result, we're on the lookout for talented individuals to join our team.We want to be upfront about our hiring process. At this moment, we are in the process of securing projects that align with our business goals and objectives. Our intention is to ensure that once we bring new team members on board, they will have a meaningful and impactful role to play from day one. While we might not be able to extend an offer immediately, we are highly interested in considering you for these future projects.If you're open to the idea of potentially joining our team in the future, we encourage you to continue with our interview process. We value your time and effort and believe that getting to know you better will help us make an informed decision.Once you have effectively concluded the entire recruitment procedure, we will retain your profile and reach out to you once a suitable opportunity emerges. Additional interviews will not be necessary at this stage, and we anticipate being able to extend an offer to you promptly.What does our recruitment process look like? Recruiter ScreenIn the first call, our recruiter will learn more about you and your story to check a potential fit for gravity9. This is also an opportunity to ask your questions about the role and company. This step might take around 60 mins. Tech Interview with our software consultantsIn this meeting your potential future teammate will take a deeper dive into your experience and what you could bring to the team.This step will take around 60 mins. Final InterviewYou made it to the very last stage! Here we already strive to cooperate with you and give you an opportunity to meet our leadership team during this informal talk. This step will take around 30 mins.Thank you for considering the opportunity to be a part of our growing journey. We look forward to the possibility of working together and achieving great things.Role DescriptionWe are looking for a smart, enthusiastic AI/ML Engineer or Data Scientist who is passionate about leveraging artificial intelligence and machine learning to solve complex problems. As an integral member of our team, you'll be responsible for conceptualizing, developing, and deploying innovative AI/ML solutions. This role offers the opportunity to work on diverse projects, providing bespoke solutions to our clients.We believe small, multi-disciplinary teams are most effective in delivering complex change. As such, we are looking for someone with a collaborative mindset who is happy to be flexible and take on different responsibilities over the lifetime of our projects.As an AI/ML Engineer, you will be an experienced developer with a strong interest in state-of-the-art AI and Machine Learning technologies. You’ll be primarily “hands-on” and actively providing technical expertise across a broad range of AI/ML disciplines, including NLP, especially LLMs and RAGs, Computer Vision, and Machine Learning.Responsibilities:Engage with clients to understand their unique challenges and deliver tailored AI/ML solutions.Design, implement, and maintain scalable, efficient, and robust end-to-end ML/AI systems.Manage the entire ML/AI development lifecycle, including planning, pipeline management, and deployment.Provide technical support to engineering team members, promoting best practices in ML engineering.Collaborate with AI Practice Lead to inform and shape the company's AI strategic direction.Role Requirements - Technical Skills And ExperienceThis role will suit a highly capable AI/ML Engineer with at least 5 years of experience working with Azure. Skills and experience should include:Extensive experience in AI/ML development, particularly in NLP, computer vision, and machine learning domains.Robust software engineering background, with a track record of leading agile teams and expedited delivery of complex projects.Proficiency in designing and maintaining AI/ML solutions that are cost-effective, accurate, and scalable.Exceptional problem-solving skills and the ability to think analytically.Strong communication and interpersonal skills, with the aptitude to navigate complex project requirements with clients and stakeholders.A growth mindset with a commitment to personal and professional development.Excellent command/highly proficient in spoken and written English (working directly with UK/US based clients).Essential skills:Advanced knowledge of Python specifically for machine learning and data science.Experience with ML/DL frameworks like TensorFlow, Keras, PyTorch, and scikit-learn.Familiarity with LLM frameworks such as LangChain, LlamaIndex, or Haystack.Proficiency in cloud services related to ML/AI (e.g., Azure, OpenAI, Hugging Face, AWS, GCP).Nice to have:Certification as an Azure AI Engineer Associate or equivalent credentials is highly advantageous.Leadership experience.Experience with C# or Java, node.js,Knowledge in MLOps, encompassing the ML applications development lifecycle and toolsets.Role Requirements – Soft SkillsKey attributes and behaviours to succeed in this role will be:Customer Focus – passion for understanding the problem we are trying to solve with software and to advocate solutions to your client.Delivery focus - strong analysis and problem-solving skills. Ability to evaluate, design and implement effective solutions. Flexibility to adapt skills to a spectrum of client engagements, use cases and modes of change delivery.Exemplary standards of personal integrity and respect for others – professional approach to all aspects of client engagement and collaborative team working, able to quickly build relationships based on trust and transparency. Strong presentation and written and verbal communication are essential given the client facing nature of the role.Value driven - Creative thinking, with aptitude for innovation and strong desire to exceed client expectations.Energy – positive attitude and determination to learn and succeed.For more information about working at gravity9 please go to www.gravity9.com.\",\n",
