       "  'job_link': 'https://uk.linkedin.com/jobs/view/machine-learning-engineer-at-datatonic-3839397118?position=10&pageNum=7&refId=dB5talFTm4NhMKQ6X%2FKDHw%3D%3D&trackingId=sKjQTUESdxCB6txVGcuALw%3D%3D&trk=public_jobs_jserp-result_search-card',\n",
       "  'job_id': '3839397118',\n",
       "  'company_name': 'Datatonic',\n",
       "  'company_profile': 'https://uk.linkedin.com/company/datatonic?trk=public_jobs_jserp-result_job-search-card-subtitle',\n",
       "  'job_location': 'London, England, United Kingdom',\n",
